import './App.css';
import MainPage from './pages/mainPage'
import AppBar from './components/appBar';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <AppBar/>
      <Routes>
        <Route path="/" element={<MainPage />}/>
      </Routes>

    </>

  );
}

export default App;
